import { Box, InputAdornment, OutlinedInput } from "@mui/material";
import React from "react";
import SearchIcon from "@mui/icons-material/Search";
import { ChatEngineWrapper, ChatList, ChatSocket } from "react-chat-engine";

const Chat = () => {
  return (
    <Box pt="20px" pl="29px" pr="39px">
      <OutlinedInput
        fullWidth
        placeholder="Search"
        id="outlined-adornment-password"
        endAdornment={
          <InputAdornment position="end">
            <SearchIcon />
          </InputAdornment>
        }
        size="small"
        sx={{ height: "32px" }}
      />
      {/* <ChatEngine
        projectID="e6ec3c5e-784a-4e8e-a39c-3f544022765c"
        userName="Michelle"
        userSecret="123"
        height="20px"
      /> */}
      <ChatEngineWrapper height="20px">
        <ChatSocket
          projectID="e6ec3c5e-784a-4e8e-a39c-3f544022765c"
          userName="Michelle"
          userSecret="123"
        >
          <ChatList />
        </ChatSocket>
      </ChatEngineWrapper>
    </Box>
  );
};

export default Chat;
